 name: 'Docker Template'
 description: 'Docker Template'
 createdBy: Template
 longDescription: Docker Template for custom launches.
 defaultPlatform: 'UNIX'
 defaultArchitecture: 'I64' 
 defaultStartupScript: |
                        #!/bin/bash
                        export AGENT_BASE_URL=https://dcmagentdockerdemo.s3.amazonaws.com
                        curl -sSLO --retry 5 $AGENT_BASE_URL/agent_docker.sh
                        url="http://metadata.google.internal/computeMetadata/v1/instance/attributes/es-dmcm-launch-id"
                        curl -s $url > /dev/null
                        if [ $? -eq 0 ]; then
                            export DCM_AGENT_FORCE_DISTRO_VERSION=debian-7.7-amd64
                        fi
                        export DCM_URL=${dcm.callback.url}
                        /bin/bash agent_docker.sh
 defaultTcpPorts: '22 80 443'
 type: 'DOCKER_1' 
